$(function(){App.init();App.markNavByURL(window.activeURL);App.attachPjax(null,{onclick:function(a){if($(a).data("marknav")){App.unmarkNav($(a),$(a).data("marknav"));App.markNav($(a),$(a).data("marknav"))}},onend:function(a,t,p){p.container.find('[data-popover="popover"]').popover();p.container.find('.ttip, [data-toggle="tooltip"]').tooltip()}});App.attachAjaxURL();App.bottomFloat(".pagination");App.bottomFloat(".form-submit-group",0,true);if(window.errorMSG)App.message({title:App.i18n.SYS_INFO,text:window.errorMSG,class_name:"danger"});if(window.successMSG)App.message({title:App.i18n.SYS_INFO,text:window.successMSG,class_name:"success"});App.notifyListen()});